import React, { Component } from 'react';
import { Row, Col } from 'react-bootstrap';
import './About.css'

class About extends Component {
    render(){
        return(
            <Row>
                <Col className="col" xs="4" sm="4" md="4" lg="3" style={{height: '900px'}}>Get</Col>
                <Col className="col" xs="4" sm="4" md="6" lg="6" style={{height: '900px'}}>in</Col>
                <Col className="col" xs="4" sm="4" md="4" lg="3" style={{height: '900px'}}>touch!</Col>
            </Row>
        )
    }
}
export default About
